(405,	'Ha Long',	'ha-long',	NULL,	'Ha Long Bay is a stunning bay located in the northeast of Vietnam. It is known for its over 1,600 limestone karsts that rise out of the emerald waters, creating a breathtaking landscape. The bay is also home to a number of caves and beaches',	NULL,	0,	1,	10,	NULL,	1,	'2024-03-10 10:10:58',	'2024-04-04 11:31:34',	0,	'',	0,	NULL,	0,	NULL,	NULL,	NULL,	1,	NULL),
(406,	'Ninh Binh',	'ninh-binh',	NULL,	'Ninh Binh is known for its stunning natural beauty, including limestone karsts, rivers, and caves. It is also home to a number of historical and cultural sites, including the ancient capital of Hoa Lu',	NULL,	0,	1,	10,	NULL,	1,	'2024-03-10 10:18:18',	'2024-04-04 11:29:33',	0,	'',	0,	NULL,	0,	NULL,	NULL,	NULL,	1,	NULL),
(408,	'Hoi An',	'hoi-an',	NULL,	'Hoi An is a charming town located in central Vietnam. It is known for its well-preserved ancient architecture, colorful lanterns, and delicious food',	NULL,	0,	1,	10,	NULL,	1,	'2024-03-13 07:31:37',	'2024-04-04 11:24:47',	0,	'',	0,	NULL,	0,	NULL,	NULL,	NULL,	1,	NULL),
