(420,	'Da Lat',	'da-lat',	NULL,	'Da Lat is a beautiful city located in the Central Highlands of Vietnam. It is known for its cool climate, stunning scenery, and French colonial architecture',	NULL,	NULL,	1,	10,	NULL,	1,	'2024-03-30 12:04:19',	'2024-04-04 11:26:11',	NULL,	NULL,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	1,	NULL),
