(422,	'Sapa',	'sapa',	NULL,	'Sapa is a breathtaking mountain town located in the northwest of Vietnam. It is renowned for its stunning rice terraces, misty valleys, and majestic Fansipan Mountain, the highest peak in Indochina',	NULL,	NULL,	1,	10,	NULL,	1,	'2024-04-02 17:50:00',	'2024-04-04 11:19:20',	NULL,	NULL,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	1,	NULL),
(423,	'Da Nang',	'da-nang',	NULL,	'Da Nang is a perfect destination for those seeking a vibrant and exciting vacation with a mix of beach relaxation, sightseeing, and cultural experiences',	NULL,	NULL,	1,	10,	NULL,	1,	'2024-04-04 03:24:38',	'2024-04-04 11:23:32',	NULL,	NULL,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	1,	NULL),
(424,	'Phu Quoc',	'phu-quoc',	NULL,	'Phu Quoc is the largest island in Vietnam. It is known for its pristine beaches, crystal-clear waters, and lush rainforests, making it a perfect destination for a tropical getaway',	NULL,	NULL,	1,	10,	NULL,	1,	'2024-04-04 03:39:43',	'2024-04-04 11:21:50',	NULL,	NULL,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	1,	NULL),
(425,	'Ho Chi Minh City',	'ho-chi-minh-city',	'<p>Thời điểm th&iacute;ch hợp nhất để du lịch Th&agrave;nh phố Hồ Ch&iacute; Minh l&agrave; từ th&aacute;ng 12 đến th&aacute;ng 4 năm sau, khi thời tiết m&aacute;t mẻ v&agrave; &iacute;t mưa.</p>\r\n\r\n<p>N&ecirc;n đặt ph&ograve;ng kh&aacute;ch sạn v&agrave; v&eacute; m&aacute;y bay sớm để c&oacute; gi&aacute; tốt nhất.</p>\r\n\r\n<p>Th&agrave;nh phố Hồ Ch&iacute; Minh hứa hẹn sẽ mang đến cho bạn những trải nghiệm du lịch tuyệt vời với sự kết hợp h&agrave;i h&ograve;a giữa hiện đại v&agrave; truyền thống, s&ocirc;i động v&agrave; b&igrave;nh y&ecirc;n. H&atilde;y đến v&agrave; kh&aacute;m ph&aacute; th&agrave;nh phố s&ocirc;i động n&agrave;y!</p>',	'Thành phố Hồ Chí Minh, hay còn được biết đến với tên gọi Sài Gòn, là một thành phố du lịch sôi động và đầy sức sống, nơi giao thoa giữa nét hiện đại và truyền thống. Nơi đây luôn chào đón du khách với những trải nghiệm độc đáo và khó quên.',	NULL,	NULL,	1,	10,	NULL,	1,	'2024-04-04 04:08:40',	'2024-04-04 04:33:23',	NULL,	NULL,	0,	NULL,	NULL,	NULL,	NULL,	NULL,	1,	NULL),
