(996,	'Package Tour to explore Northern Vietnam',	NULL,	'package-tour-to-explore-northern-vietnam',	NULL,	NULL,	NULL,	NULL,	'Northern Vietnam is a land steeped in history and culture, where ancient legends and myths come alive. Renowned for its majestic natural landscapes, unique historical and cultural relics, and friendly and welcoming people, Northern Vietnam offers an unforgettable travel experience.',	'product/ha-long-1.jpg',	1,	1,	NULL,	NULL,	NULL,	NULL,	1,	'2024-04-05 05:11:14',	'upload/2024/04/05/428433329-375210085270000-8383513352812661437-n.jpg|upload/2024/04/05/428446881-375210111936664-402325268259919672-n.jpg|upload/2024/04/05/428451951-375210065270002-8660437406803522260-n.jpg|upload/2024/04/05/428452767-375210048603337-3074553114357911236-n.jpg|upload/2024/04/05/428458811-375210121936663-1180643860031415264-n.jpg|upload/2024/04/05/428473247-375210138603328-2613370163163632459-n.jpg|',	5,	1,	'|398|422|406|405|',	NULL,	NULL,	'2024-04-15 16:12:55',	NULL,	NULL,	1,	1500,	NULL,	1,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	1,	10,	'|416|412|415|',	NULL,	NULL,	10,	'<p><strong>Days 1-2:&nbsp; Explore Hanoi</strong></p>\r\n\r\n<p><strong>Days 3-4-5: Explore Sapa</strong></p>\r\n\r\n<p><img alt=\"\" src=\"https://dulich-english.khoweb.top/public/filemanager/userfiles/Sapa%201.jpg\" style=\"height:185px; width:300px\" />&nbsp;&nbsp;<img alt=\"\" src=\"https://dulich-english.khoweb.top/public/filemanager/userfiles/Sapa%201.jpg\" style=\"height:185px; width:300px\" />&nbsp;&nbsp;<img alt=\"\" src=\"https://dulich-english.khoweb.top/public/filemanager/userfiles/Sapa%201.jpg\" style=\"height:185px; width:300px\" /></p>\r\n\r\n<p><strong>Days 6-7: Explore Ha Long</strong></p>\r\n\r\n<p><img alt=\"\" src=\"https://dulich-english.khoweb.top/public/filemanager/userfiles/Ha%20Long%201.jpg\" style=\"height:186px; width:300px\" />&nbsp;&nbsp;<img alt=\"\" src=\"https://dulich-english.khoweb.top/public/filemanager/userfiles/Ha%20Long%201.jpg\" style=\"height:186px; width:300px\" /></p>\r\n\r\n<p><strong>Days 8: Explore Ninh Binh</strong></p>\r\n\r\n<p><strong>Days 9-10: Back to Hanoi&nbsp;</strong></p>',	'<ul>\r\n	<li>5-stars&nbsp;Hotels with breakfast</li>\r\n	<li>Sightseeing tickets &amp; cable car tickets</li>\r\n	<li>Travel insurance ($2500/pax)</li>\r\n	<li>Tour guide</li>\r\n	<li>Transportation</li>\r\n</ul>',	'<ul>\r\n	<li>Meals</li>\r\n	<li>Tips for tour guides</li>\r\n	<li>Other expenses at the hotel (spa, laundry, bar...)</li>\r\n</ul>',	NULL),
(997,	'Package Tour to Vietnam',	NULL,	'package-tour-to-vietnam',	NULL,	NULL,	NULL,	NULL,	'Explore the most beautiful and famous places in Northern Vietnam with us. You will be amazed and delighted by the majestic natural scenery and tropical diversity here.',	'product/sapa-1.jpg',	1,	1,	NULL,	NULL,	NULL,	NULL,	1,	'2024-04-05 05:58:41',	'upload/2024/04/05/434108160-122126274710217469-2766862754210461365-n.jpg|upload/2024/04/05/434254929-122126274704217469-550148721587740020-n.jpg|upload/2024/04/05/434211284-122127776090217469-8969969285429522629-n.jpg|upload/2024/04/05/431761415-122121209030217469-8214796930550628810-n.jpg|upload/2024/04/05/431368572-122118585902217469-3425304717511663580-n.jpg|',	4,	1,	'|398|422|405|406|',	NULL,	NULL,	'2024-04-15 16:11:17',	NULL,	NULL,	1,	950,	NULL,	1,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	1,	20,	'|414|416|',	'2024-04-24 00:00:00',	NULL,	10,	'<p style=\"text-align:justify\"><strong>Day 1: Arrive in Hanoi</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Day 2:&nbsp;Trip from Hanoi to Sapa by car.</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Day 3:&nbsp;Sapa&nbsp;Day 2</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Day 4: Back to Hanoi.</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Day 5: Trip to Ha Long Bay&nbsp;</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Day 6: Back to Hanoi</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Day 7:&nbsp; Journey around Hanoi city center</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Day 8:&nbsp;Trip from Hanoi to Ninh Binh</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Day 9:&nbsp;Rest or visit the oud factory</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Day 10:&nbsp;Depart from Hanoi to your country.</strong></p>',	'<ul>\r\n	<li>Transport vehicles with 35 seats for a trip of 10 days and 9 nights</li>\r\n	<li>4-star hotel (2 people per room)</li>\r\n	<li>4-star hotel (one person per room)</li>\r\n	<li>5 star ship in Halong Bay</li>\r\n	<li>Breakfast buffet at the hotel</li>\r\n	<li>Lunch and dinner on the ship</li>\r\n	<li>&nbsp;A tour guide who speaks Arabic or English</li>\r\n	<li>The cost of the electronic visa</li>\r\n</ul>',	'<ul>\r\n	<li style=\"text-align: justify;\">Activities outside the program</li>\r\n	<li style=\"text-align: justify;\">Personal expenses, telephone, mini-bar sink in the hotel and ship</li>\r\n	<li style=\"text-align: justify;\">Tour guide and car driver commission (if any)</li>\r\n	<li style=\"text-align: justify;\">Value added tax</li>\r\n	<li style=\"text-align: justify;\">International and local flight tickets</li>\r\n</ul>',	NULL),
(999,	'Vietnam Package Tour',	NULL,	'vietnam-package-tour-1712377753',	NULL,	NULL,	NULL,	NULL,	'Vietnam is an extremely diverse destination, and you\'ll often find that your own reasons for wanting to visit will be completely different from those of others. For nature lovers, the beaches and famous landmarks such as Ha Long Bay will be the biggest attraction. Additionally, Vietnam is incredibly inexpensive, which is great for budget travelers, but also offers a tempting opportunity to splurge on luxury hotels since you can be found for a better rate than in other parts of the world. Let\'s discover Vietnam with our 15-day 14-night package to fully experience the beauty of Vietnam.',	'product/mu.jpg',	1,	1,	NULL,	NULL,	NULL,	NULL,	1,	'2024-04-06 04:29:13',	NULL,	4,	1,	'|398|405|422|406|423|408|425|',	NULL,	NULL,	'2024-04-15 16:07:24',	NULL,	NULL,	1,	1670,	NULL,	1,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	1,	10,	'|414|416|412|',	NULL,	NULL,	15,	'<p><strong>Day 1:&nbsp;Arrive to Hanoi</strong></p>\r\n\r\n<p><strong>Day 2:&nbsp;Hanoi city tour</strong></p>\r\n\r\n<p><strong><img alt=\"\" src=\"https://vietnamkool.com/public/filemanager/userfiles/Hanoi.jpg\" style=\"height:244px; width:400px\" />&nbsp; <img alt=\"\" src=\"https://vietnamkool.com/public/filemanager/userfiles/hanoi%201.jpg\" style=\"height:250px; width:400px\" /></strong></p>\r\n\r\n<p><strong>Day 3: From Hanoi to Halong bay (by limousine) on Alis cruise</strong></p>\r\n\r\n<p><strong><img alt=\"\" src=\"https://vietnamkool.com/public/filemanager/userfiles/banner/IMG_4956%20Co%20Logo.jpg\" style=\"height:255px; width:400px\" /></strong></p>\r\n\r\n<p><strong>Day 4:&nbsp;A half day on cruise and come back to Hanoi by limousine</strong></p>\r\n\r\n<p><strong>Day 5:&nbsp;Hanoi - Sapa by limousine</strong></p>\r\n\r\n<p><strong>Day 6: Explore Sapa</strong></p>\r\n\r\n<p><strong>Day 7:&nbsp;Back to Hanoi by limousine and rest</strong></p>\r\n\r\n<p><strong>Day 8:&nbsp;Ninh Binh tour</strong></p>\r\n\r\n<p><strong>Day 9:&nbsp;Hanoi fly to Da Nang by plane</strong></p>\r\n\r\n<p><strong>Day 10: Explore Danang</strong></p>\r\n\r\n<p><strong>Day 11:&nbsp;Da Nang to Hoi An by car</strong></p>\r\n\r\n<p><strong>Day 12:&nbsp;Da Nang fly to Ho Chi Minh city by plane</strong></p>\r\n\r\n<p><strong>Day 13:&nbsp;Mekong tour</strong></p>\r\n\r\n<p><strong>Day 14:&nbsp;Ho Chi Minh city tour &amp; Cu Chi Tunnel:</strong></p>\r\n\r\n<p><strong>Day 15:&nbsp;Ho Chi Minh Departure</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',	'<ul>\r\n	<li style=\"text-align: justify;\">7-seat and 9-seat moving vehicles</li>\r\n	<li style=\"text-align: justify;\">Domestic air tickets from Hanoi to Da Nang and from Da Nang to Ho Chi Minh city</li>\r\n	<li style=\"text-align: justify;\">Limousine or Sleeper bus from Hanoi to Sapa and vice versa</li>\r\n	<li style=\"text-align: justify;\">4-star hotel (two people per room)</li>\r\n	<li style=\"text-align: justify;\">Tour guide</li>\r\n	<li style=\"text-align: justify;\">Ha Long Cruise during two day one night (4 meals)</li>\r\n	<li style=\"text-align: justify;\">E-Visa</li>\r\n	<li style=\"text-align: justify;\">Tickets to visit destinations included in the program</li>\r\n	<li style=\"text-align: justify;\">Tickets for Fansipan cable car, mountain train and Muong Hoa train in Sapa</li>\r\n	<li style=\"text-align: justify;\">Tickets for Bana cable car</li>\r\n	<li style=\"text-align: justify;\">Travel insurance</li>\r\n	<li style=\"text-align: justify;\">One bottle of water/person/day</li>\r\n	<li style=\"text-align: justify;\">Breakfast buffet</li>\r\n</ul>',	'<ul>\r\n	<li style=\"text-align: justify;\">&nbsp;Activities outside the program</li>\r\n	<li style=\"text-align: justify;\">Vehicle costs after scheduled hours</li>\r\n	<li style=\"text-align: justify;\">Per diem for the tour guide after hours during the program</li>\r\n	<li style=\"text-align: justify;\">Tip fee for tour guides and drivers (2$/per/day)</li>\r\n</ul>',	NULL),
(1000,	'Private Tour package',	NULL,	'private-tour-package',	NULL,	NULL,	NULL,	NULL,	'Northern Vietnam is a land steeped in history and culture, where ancient legends and myths come alive. Renowned for its majestic natural landscapes, unique historical and cultural relics, and friendly and welcoming people, Northern Vietnam offers an unforgettable travel experience.',	'product/img-4956-co-logo.jpg',	1,	1,	NULL,	NULL,	NULL,	NULL,	1,	'2024-04-11 03:42:19',	'upload/2024/04/11/433207397-122122024784217469-3342263108993533730-n.jpg|upload/2024/04/11/434211284-122127776090217469-8969969285429522629-n.jpg|upload/2024/04/11/431652394-122118585224217469-3763044492674053511-n.jpg|',	4,	1,	'|398|405|406|422|',	NULL,	NULL,	'2024-04-17 10:57:10',	NULL,	NULL,	1,	1100,	NULL,	1,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	1,	2,	'|412|416|414|426|',	NULL,	NULL,	10,	'<p><strong>Days 1-2: Hanoi</strong></p>\r\n\r\n<p><strong>Days 3-4-5: Sapa</strong></p>\r\n\r\n<ul>\r\n</ul>\r\n\r\n<p><strong>Days 6-7: Ha Long</strong></p>\r\n\r\n<p><strong>Days 8: Ninh Binh</strong></p>\r\n\r\n<ul>\r\n</ul>\r\n\r\n<p><strong>Days 9-10: Hanoi&nbsp;</strong></p>',	'<ul>\r\n	<li>4-stars&nbsp;Hotels with breakfast</li>\r\n	<li>Sightseeing tickets &amp; cable car tickets</li>\r\n	<li>Travel insurance ($2500/pax)</li>\r\n	<li>Tour guide</li>\r\n	<li>Transportation</li>\r\n</ul>',	'<ul>\r\n	<li>Meals</li>\r\n	<li>Tips for tour guides</li>\r\n	<li>Other expenses at the hotel (spa, laundry, bar...)</li>\r\n</ul>',	NULL);
