(39,	'home_content',	'Giới Thiệu',	'<p dir=\"ltr\"><img alt=\"\" src=\"http://ceochiakhoathanhcong.com/pic/AboutUs/images/_34A2929(1).jpg\" /> 1. CEO - Ch&igrave;a kho&aacute; th&agrave;nh c&ocirc;ng l&agrave; chương tr&igrave;nh kinh tế chuy&ecirc;n biệt v&agrave; phi lợi nhuận của VTV để đồng h&agrave;nh c&ugrave;ng cộng đồng doanh nghiệp thời kinh tế trường v&agrave; hội nhập to&agrave;n cầu.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">2. CEO - Ch&igrave;a kho&aacute; th&agrave;nh c&ocirc;ng được thực hiện theo h&igrave;nh thức X&atilde; hội ho&aacute; với sự hợp t&aacute;c của Ho&agrave;nggia Media Group, Nh&agrave; tư vấn doanh nghiệp v&agrave; sản xuất chương tr&igrave;nh truyền h&igrave;nh chuy&ecirc;n nghiệp c&oacute; lịch sử 20 năm tại Việt Nam. Chi ph&iacute; x&acirc;y dựng format, x&acirc;y dụng nội dung, sản xuất v&agrave; l&ecirc;n s&oacute;ng khoảng 50 tỷ/năm.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">3. CEO - Ch&igrave;a kho&aacute; th&agrave;nh c&ocirc;ng l&agrave; một thương hiệu lớn, uy t&iacute;n, gắn liền với &yacute; niệm Tr&aacute;ch nhiệm x&atilde; hội v&agrave; sự tận t&acirc;m: &nbsp;Duy tr&igrave; chất lượng v&agrave; gi&aacute; trị đ&iacute;ch thực suốt 12 năm tr&ecirc;n s&oacute;ng Đ&agrave;i truyền h&igrave;nh quốc gia. CEO - Ch&igrave;a kho&aacute; th&agrave;nh c&ocirc;ng đ&atilde; mang lại kiến thức, kinh nghiệm thiết thực cho sự ph&aacute;t triển của doanh nghiệp Việt Nam. Đặc biệt l&agrave; những người trẻ v&agrave; c&aacute;c doanh nghiệp SME. Th&uacute;c đẩy v&agrave; hỗ trợ ph&aacute;t triển cho h&agrave;ng trăm ng&agrave;n Doanh nghiệp, doanh nh&acirc;n trực tiếp trong chương tr&igrave;nh v&agrave; qua s&oacute;ng truyền h&igrave;nh. Nhiều CEO trong chương tr&igrave;nh từ những phi&ecirc;n bản đầu đ&atilde; trưởng th&agrave;nh v&agrave; trở th&agrave;nh Chuy&ecirc;n gia của chương tr&igrave;nh.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">4. CEO - Ch&igrave;a kho&aacute; th&agrave;nh c&ocirc;ng đ&atilde; lan toả khắp trong cộng đồng người Việt Nam ở trong nước v&agrave; tr&ecirc;n to&agrave;n cầu qua hơn 12 năm li&ecirc;n tục tr&ecirc;n s&oacute;ng VTV1, VTV4, VTV6, mạng x&atilde; hội v&agrave; c&aacute;c k&ecirc;nh online kh&aacute;c.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">5. CEO - Ch&igrave;a kho&aacute; th&agrave;nh c&ocirc;ng l&agrave; chương tr&igrave;nh thiết thực v&agrave; c&oacute; t&iacute;nh thời sự kinh tế cao: Trong 12 năm qua đ&atilde; c&oacute; 7 phi&ecirc;n bản: &nbsp;</p>\r\n\r\n<p dir=\"ltr\">- 2005 &ldquo;Kế s&aacute;ch l&agrave;m gi&agrave;u&rdquo;: Khơi dậy tinh thần l&agrave;m gi&agrave;u v&agrave; tư duy kinh doanh b&agrave;i bản</p>\r\n\r\n<p dir=\"ltr\">- 2006 &ldquo;Đường tới th&agrave;nh c&ocirc;ng&rdquo;: Sinh vi&ecirc;n c&aacute;c trường kinh tế thi ph&acirc;n t&iacute;ch c&aacute;c nguy&ecirc;n l&yacute; kinh doanh b&agrave;i bản của c&aacute;c điển h&igrave;nh kinh doanh th&agrave;nh c&ocirc;ng.</p>\r\n\r\n<p dir=\"ltr\">- 2007 - 2008 &ldquo;Ch&igrave;a kho&aacute; th&agrave;nh c&ocirc;ng My Way&rdquo;: Truyền b&aacute; kỹ năng mềm v&agrave; vă ho&aacute; ứng xử trong doanh nghiệp</p>\r\n\r\n<p dir=\"ltr\">- 2009 - 2012 &ldquo;Ch&igrave;a kho&aacute; th&agrave;nh c&ocirc;ng CEO&rdquo;: Đồng h&agrave;nh c&ugrave;ng c&aacute;c CEO thời khủng hoảng</p>\r\n\r\n<p dir=\"ltr\">- 2013 - 2017 &ldquo;Ch&igrave;a kho&aacute; th&agrave;nh c&ocirc;ng CEO SME&rdquo;: &nbsp;Với c&aacute;c biến thể ph&ugrave; hợp với xu hướng kinh tế nhứ CEO SME thời EAC, CEO SME thời TTP, CEO Doanh nghiệp gia đ&igrave;nh</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">6. CEO - Ch&igrave;a kho&aacute; th&agrave;nh c&ocirc;ng 2018 - Phi&ecirc;n bản &ldquo;Doanh nghiệp vững bền&rdquo; tập trung giải quyết 2 vấn đề lớn:</p>\r\n\r\n<p dir=\"ltr\">- Khởi nghiệp th&agrave;nh c&ocirc;ng</p>\r\n\r\n<p dir=\"ltr\">- Doanh nghiệp thời 4.0</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">7. CEO - Ch&igrave;a kho&aacute; th&agrave;nh c&ocirc;ng được nhiều tổ chức uy t&iacute;n bảo trợ v&agrave; đồng h&agrave;nh: VCCI,Trung ương hội c&aacute;c Hiệp hội doanh nghiệp Việt Nam, Hiệp hội doanh nghiệp TP Hồ Ch&iacute; Minh, PwC Việt Nam&hellip;.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">8. Những t&ecirc;n tuổi lớn đ&atilde; đồng h&agrave;nh c&ugrave;ng chương tr&igrave;nh trong những năm qua : Pepsi co., Berjaya Việt Nam, Th&eacute;p Pomina, Traphaco, Novaland&hellip; qua đ&oacute;:</p>\r\n\r\n<p dir=\"ltr\">8.1. Thể hiện tấm l&ograve;ng v&agrave; vai tr&ograve; x&atilde; hội của Doanh nghiệp</p>\r\n\r\n<p dir=\"ltr\">8.2. Đ&oacute;ng g&oacute;p thiết thực cho sự ph&aacute;t triển Đất nước</p>\r\n\r\n<p dir=\"ltr\">8.3. Lan toả gi&aacute; trị cộng đồng của Doanh nghiệp</p>\r\n\r\n<p dir=\"ltr\">8.4. Cộng hưởng gi&aacute; trị thương hiệu c&ugrave;ng c&aacute;c thương hiệu lớn kh&aacute;c: VTV, VCCI, PwC.</p>\r\n\r\n<p dir=\"ltr\">&nbsp;</p>\r\n\r\n<p dir=\"ltr\">9. Gi&aacute; trị nhận được của c&aacute;c Doanh nghiệp Vừa v&agrave; Nhỏ khi tham gia chương tr&igrave;nh:</p>\r\n\r\n<p dir=\"ltr\">9.1. Được n&acirc;ng tầm v&agrave; lan toả t&ecirc;n tuổi, thương hiệu c&aacute; nh&acirc;n v&agrave; c&ocirc;ng ty qua s&oacute;ng VTV1, VTV4, VTV6 v&agrave; c&aacute;c k&ecirc;nh online kh&aacute;c.</p>\r\n\r\n<p dir=\"ltr\">9.2. Được trải nghiệm nhũng b&agrave;i to&aacute;n s&aacute;t với thực tế, thử th&aacute;ch để trưởng th&agrave;nh</p>\r\n\r\n<p dir=\"ltr\">9.3. Được Huấn luyện bởi Tập đo&agrave;n tư vấn PwC (&ldquo;Big Four&rdquo; to&agrave;n cầu)</p>\r\n\r\n<p dir=\"ltr\">9.4. Được tiếp x&uacute;c với Big Boss TOP 50 Doanh nghiệp gia đ&igrave;nh h&agrave;ng đầu Việt Nam</p>\r\n\r\n<p dir=\"ltr\">9.5. Được tham gia CEO - CKTC CLUB c&ugrave;ng c&aacute;c kỳ workshop v&agrave; c&aacute;c hoạt động online v&agrave; offline... học hỏi, chia sẻ kiến thức v&agrave; kinh nghiệm kinh doanh.</p>',	0,	NULL,	NULL,	0,	'html',	NULL,	NULL,	NULL),
