(114,	'about_widget_7',	'Personalized Trips',	'<p>A personalized trip is a type of travel tailored specifically to a traveler&#39;s personal interests and needs.</p>',	1,	NULL,	NULL,	1,	'html',	NULL,	'',	NULL),
