(117,	'faq_widget',	'When is the best time to travel to Vietnam?',	'<p>The best time to travel to Vietnam is between February through April as well as August to October as rainfall is lighter and temperatures are moderate.&nbsp;</p>',	0,	NULL,	NULL,	1,	'html',	NULL,	'',	NULL),
