(119,	'faq_widget',	'Is it safe to drink tap water?',	'<p>It is strongly advised NOT to drink tap water in Vietnam. It&rsquo;s best to stick to boiled, treated or bottled water.</p>',	4,	NULL,	NULL,	1,	'html',	NULL,	'',	NULL),
(120,	'faq_widget',	'What are the public bathroom facilities like ?',	'<p>While western-style facilities will be found in large hotels and some tourist areas, the standard facility will be the squat toilet. Tissue is not always provided so it is best to bring some with you, as well as a hand sanitizer.</p>',	3,	NULL,	NULL,	1,	'html',	NULL,	'',	NULL),
(121,	'faq_widget',	'What are transportation options in Vietnam?',	'<p>There are many ways to get around in Vietnam. Domestic flights within the country can allow quick and convenient travel between the north and south parts of the country. Trains or hired drivers are also available to visit smaller towns or villages. Bicycle rentals are also available to get around city and town areas.&nbsp;</p>',	2,	NULL,	NULL,	1,	'html',	NULL,	'',	NULL),
